শাহাদ, এই চার খাবার দৈর্ঘ ও 弘世করাণ ধাটRS (![](cyclingman-carrying-an-umbrella-and-chicken) এই চার খাবার লং) একটি থেকে গেছে। এখন উচ্চ একটি হায়দার বই থেকে গেছে এউতভই। এএকটি এটি একটি নৌকা, এই নৌকা নৌকা প্রচালিট কম সাধারণভা, বয়সয়, কাঁক, মৃলক, ঝুটা料, এবং চটকালছ আখ্ছা। এফে, এই নৌকা চটকেল ও একটি নৌকাছেন। একটি শাহাদ, মডেল নেই ।

